-- TOC entry 269 (class 1255 OID 34996)
-- Name: calcular_cobranca(character varying, character, date, date); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION calcular_cobranca(var_matricula character varying, periodo_tipo character, data_inicio date, data_fim date) RETURNS integer
    LANGUAGE plpgsql STRICT
    AS $$
DECLARE
  registro RECORD;
  num_boleto bigint;
  valor_total numeric(9,2);
  num_nosso_numero varchar(20);
  num_documento varchar(10);
  mul smallint;
  tot smallint;
  resto smallint;
BEGIN
   <<loop_registro>>
   FOR registro IN
   SELECT c.id_responsavel_financeiro
        , p.id_parcela
        , p.data_vencimento
        , p.valor
        , pp.id_banco
        , pp.id_agencia
        , pp.id_conta_corrente
        , s.id_servico
        , pp.carteira
        , p.competencia
     --INTO registro  
     FROM public.contrato c
    INNER JOIN public.parcela p ON (c.id_contrato = p.id_contrato)
    INNER JOIN public.plano_pagamento pp ON (c.id_plano_pagamento = pp.id_plano_pagamento)
    INNER JOIN public.servico s ON (p.id_servico = s.id_servico)
    WHERE ((p.data_vencimento BETWEEN data_inicio AND data_fim AND 'v' = periodo_tipo)
       OR (p.competencia BETWEEN data_inicio AND data_fim AND 'c' = periodo_tipo))
      AND c.matricula = var_matricula
      AND not p.cobrada
	LOOP
    	num_documento := rtrim(to_char(registro.competencia::date, 'YY') || to_char(registro.competencia::date, 'MM')) || ltrim(to_char(registro.id_responsavel_financeiro::bigint, '000000'));
        VALUES (registro.id_responsavel_financeiro, 'A', num_documento, 
                registro.id_conta_corrente, registro.id_banco, registro.id_agencia, registro.carteira, 
                now(), 'maurilio', registro.data_vencimento);
        SELECT currval('boleto_id_boleto_seq') into num_boleto;
        VALUES (num_boleto, registro.id_servico, registro.valor, registro.id_parcela, 'maurilio', now());
        
		/* obtendo o valor total do boleto */
		SELECT SUM(valor) into valor_total FROM item_boleto WHERE id_boleto = num_boleto;
        
		/* calculando o nosso numero */
        mul := 2;
        tot := 0;
        num_nosso_numero = ltrim(to_char(num_boleto, '00000000000'));
        
        <<loop_nn>>
        FOR i IN 1..13 LOOP
        	tot := tot + (mul * substr(rtrim(ltrim(registro.carteira)) || ltrim(rtrim(num_nosso_numero)), i, 1)::smallint );
			mul := CASE WHEN mul = 2 THEN 7 ELSE mul-1 END;
        END LOOP loop_nn;
        
        resto := tot % 11; 
        IF resto = 1 THEN 
            num_nosso_numero := num_nosso_numero || 'P';
        ELSE 
        	num_nosso_numero := num_nosso_numero || ltrim(to_char((11-(resto)), '9'));
        END IF;
		        
        /* atualizando o boleto e parcela */
		UPDATE boleto SET valor_documento = valor_total, nosso_numero = num_nosso_numero WHERE boleto.id_boleto = num_boleto;
        UPDATE parcela SET cobrada = true WHERE id_parcela = registro.id_parcela;
    	--RETURN NEXT registro;
    END LOOP loop_registro;
      
RETURN registro.id_parcela;
END;
$$;


